0,'gaia',NULL,'libbyli','2013-09-26 09:50:25','业务对账数据延迟，请检查上报情况',NULL,NULL),('mr',NULL,0,'gaia',NULL,'libbyli','2013-10-18 15:34:25','',NULL,NULL),('arrayindex',NULL,0,'gaia',NULL,'libbyli','2013-10-29 19:14:56','',NULL,NULL),('Create new directory on target HDFS cluster for saving results failed','Create new directory on target HDFS cluster for saving results failed',2,'ifnn',NULL,'libbyli','2014-08-27 21:15:27','1、check hdfs目录权是否对用户开放','libbyli','2014-08-27'),('exit_code%9%failed_writed%success_writed','exit_code\":\"9\",\"failed_writed\":\"100194\",\"success_writed\":\"77792\"',2,'bgd',NULL,'libbyli','2014-08-27 22:03:42','原因：tdw出库数据，在入库只目标mysql（tpg）时，出现数据约束造成数据reject 解决：查看‘系统日志’最下--Bad日志查询，点击后，出现类似： java.sql.SQLException: Column \'userAmount\' cannot be null Query 可尝试（1）修改MYSQL表结构确保数据入库 或（2）修改TDW查询数据，规避异常数据','libbyli','2014-08-27'),('NegativeArraySizeException','sec_onion_interface.db/sec_t_app_config/p_20140825/attempt_1407229860715_18718321_m_000002_0.1408923137167 2014-08-26 17:31:26,522 WARN [main] org.apache.hadoop.mapred.YarnChild: Exception running child : java.lang.NegativeArraySizeException',2,'bgd',NULL,'bg','2014-08-27 22:49:47','表中有超过32k的数据 解决方案（以下任意一种）： 1、数据重新入库，并增加reject参数：set hive.errordata.process.level=1 2、重新定义表为rcfile，支持4M数据，同样需要重新入库','libbyli','2014-08-27'),('数据写入MYSQL慢','运行时间长',2,'bgc',NULL,'业务','2014-09-25 15:58:13','1、查看日志最底下，是否存在reject数据，业务自行规避 2、可能表有索引，插入慢，业务侧考虑如何优化下 3、可能存在网络传输问题，tdw资源都在深圳-同乐idc，跨IDC可能会有这种情况','libbyli','2014-09-25'),('Timed out after 600 secs','AttemptID:attempt_1407229860715_78106635_m_000132_0 Timed out after 600 secs',1,'hadoop',NULL,'业务责任人','2014-10-22 11:30:22','增加参数：set mapreduce.task.timeout=1200000','libbyli',NULL),('virtual memory used. Killing container','Container [pid=10427,containerID=container_1407229860715_78154216_01_000279] is running beyond physical memory limits. Current usage: 2.1 GB of 2 GB physical memory used; 9.5 GB of 4.2 GB virtual memory used. Killing container.',2,'hadoop',NULL,'业务','2014-10-22 12:07:34','heap over limit错误或者因内存问题被nmkill了，增加参数：set mapred.child.java.opts=-Xmx1024m','libbyli','2014-10-22'),('mr执行慢','对比map或者reduce信息，任务在部分机器上执行明显变慢',1,'hadoop',NULL,'业务责任人','2014-10-24 11:28:49','增加推测参数：set mapred.map.tasks.speculative.execution true;   set mapred.reduce.tasks.speculative.execution true;','libbyli','2014-10-24'),('Task failed because no files in the source path','',0,'tdbank',NULL,'libbyli','2015-03-17 17:25:19','check file on hdfs',NULL,'2015-03-17');
