DROP TABLE IF EXISTS `lb_runner`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `lb_runner` (
  `type_id` smallint(6) NOT NULL COMMENT '任务类型ID',
  `broker_ip` varchar(30) NOT NULL COMMENT '部署BrokerIP',
  `broker_port` int(11) DEFAULT '10000',
  `executable_path` varchar(500) NOT NULL COMMENT '可执行程序路径',
  `in_charge` varchar(30) NOT NULL COMMENT '负责人',
  `status` char(1) NOT NULL DEFAULT 'Y' COMMENT '状态(Y-启用/N-未启用)',
  `startup_time` datetime DEFAULT NULL COMMENT '启动时间',
  `last_heartbeat` datetime DEFAULT NULL COMMENT '最后心跳时间',
  `priority_limit` smallint(1) NOT NULL DEFAULT '9' COMMENT '任务优先级上线',
  `broker_parallelism` int(6) DEFAULT '0',
  `is_upgrade` int(1) DEFAULT '0',
  PRIMARY KEY (`type_id`,`broker_ip`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='任务Runner部署及运行情况';
